import React from 'react';
import { motion } from 'framer-motion';

const FadeIn = ({ children, delay = 0 }) => (
  <motion.div
    initial={{ opacity: 0, y: 12 }}
    animate={{ opacity: 1, y: 0 }}
    transition={{ duration: 0.6, delay }}
  >
    {children}
  </motion.div>
);

export default function YakushkinPortfolio() {
  return (
    <div style={{
      minHeight: '100vh',
      color: '#1e293b',
      display: 'flex',
      flexDirection: 'column'
    }}>
      {/* Hero */}
      <section
        style={{
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          flexGrow: 1,
          padding: '4rem 2rem',
          backgroundImage: 'linear-gradient(rgba(0,0,0,0.5), rgba(0,0,0,0.5)), url("public/images/photo_2025-08-22_20-29-50.jpg")',
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          color: '#fff',
          textAlign: 'center'
        }}
      >
        <FadeIn>
          <h1 style={{ fontSize: '3rem', marginBottom: '1rem' }}>Якушкин Д.О.</h1>
        </FadeIn>
        <FadeIn delay={0.1}>
          <p style={{ fontSize: '1.25rem', maxWidth: '600px' }}>
            Индивидуальный предприниматель в строительстве. Команда опытных мастеров, ориентированных на результат.
          </p>
        </FadeIn>
      </section>

      {/* About */}
      <section
        style={{
          maxWidth: '100%',
          margin: '0 auto',
          padding: '4rem 2rem',
          backgroundImage: 'linear-gradient(rgba(255,255,255,0.8), rgba(255,255,255,0.8)), url("public/images/photo_2025-08-22_20-30-08.jpg")',
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          color: '#1e293b'
        }}
      >
        <FadeIn>
          <h2 style={{ fontSize: '2rem', marginBottom: '1rem' }}>О нас</h2>
          <p>
            Мы — слаженная бригада специалистов, выполняющая строительные и ремонтные работы любой сложности.
            На нашем счету множество реализованных объектов — от загородных домов до коммерческих помещений.
            Работаем ответственно и слаженно, ценим доверие и профессионализм.
          </p>
        </FadeIn>
      </section>

      {/* Contact */}
      <section
        style={{
          maxWidth: '100%',
          margin: '0 auto',
          padding: '4rem 2rem',
          backgroundImage: 'linear-gradient(rgba(0,0,0,0.6), rgba(0,0,0,0.6)), url("public/images/photo_2025-08-22_20-30-23.jpg")',
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          color: '#fff',
          textAlign: 'center'
        }}
      >
        <FadeIn>
          <h2 style={{ fontSize: '2rem', marginBottom: '1rem' }}>Связаться</h2>
          <p style={{ marginBottom: '1rem' }}>Позвоните или напишите нам, чтобы обсудить ваш проект.</p>
          <p>📞 +7 953 447-12-18</p>
          <p>📧 dimayakyshkin6@mail.ru</p>
        </FadeIn>
      </section>

      {/* Footer */}
      <footer style={{
        textAlign: 'center',
        padding: '2rem',
        fontSize: '0.875rem',
        color: '#64748b',
        backgroundColor: '#f8fafc'
      }}>
        © {new Date().getFullYear()} Якушкин Д.О. Все права защищены.
      </footer>

      {/* Adaptive CSS for mobile devices */}
      <style>
        {`
          @media (max-width: 600px) {
            section[style*="backgroundImage"]:not(:first-child) {
              background-image: linear-gradient(rgba(0,0,0,0.7), rgba(0,0,0,0.7)), url("public/images/photo_2025-08-22_20-30-13.jpg");
            }
          }
        `}
      </style>
    </div>
  );
}
